version = "2.11.7"
requires_python = ">=3.6.2"
summary = "An abstract syntax tree for Python with inference support."
dependencies = [
    "lazy-object-proxy>=1.4.0",
    "setuptools>=20.0",
    "typed-ast<2.0,>=1.4.0; implementation_name == \"cpython\" and python_version < \"3.8\"",
