[[package]]
name = "cpplint"
version = "1.6.1"
summary = "Automated checker to ensure C++ files follow Google's style guide"

[[package]]
name = "dill"
version = "0.3.5.1"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*, !=3.5.*, !=3.6.*"
