[[package]]
name = "jinja2"
version = "3.1.2"
requires_python = ">=3.7"
summary = "A very fast and expressive template engine."
dependencies = [
    "MarkupSafe>=2.0",
]

[[package]]
name = "lazy-object-proxy"
version = "1.7.1"
