    "typing-extensions>=3.10.0; python_version < \"3.10\"",
]

[[package]]
name = "pyyaml"
version = "6.0"
requires_python = ">=3.6"
summary = "YAML parser and emitter for Python"

[[package]]
name = "setuptools"
version = "65.4.1"
requires_python = ">=3.7"
summary = "Easily download, build, install, upgrade, and uninstall Python packages"

[[package]]
name = "tomli"
version = "2.0.1"
